            money = count * 2.80;
            if(count > 80){
                money = money * 0.85; //money *= 0.85;
            }
            break;
        case 'Narcissus':
            money = count * 3.00;
            if(count < 120){
                money = money * 1.15; //money *= 1.15;
            }
            break;
        case 'Gladiolus':
            money = count * 2.50;
            if(count < 80){
                money = money * 1.2; //money *= 1.2;
            }
