    } else{
        let difference = money - budget;
        console.log(`Not enough money, you need ${difference.toFixed(2)} leva more.`);
    }
}

function calculateHotelPrice(days, roomType, feedback) {
    let nights = days - 1;
    let pricePerNight = 0;

    if (roomType === "room for one person") {
        pricePerNight = 18.00;
    } else if (roomType === "apartment") {
        pricePerNight = 25.00;
        if (nights < 10) {
            pricePerNight *= 0.70;
        } else if (nights <= 15) {
            pricePerNight *= 0.65;
        } else {
            pricePerNight *= 0.50;
        }
    } else if (roomType === "president apartment") {
        pricePerNight = 35.00;
        if (nights < 10) {
            pricePerNight *= 0.90;
        } else if (nights <= 15) {
            pricePerNight *= 0.85;
        } else {
            pricePerNight *= 0.80;
        }
    }

    let totalPrice = nights * pricePerNight;
    
    if (feedback === "positive") {
        totalPrice *= 1.25;
    } else if (feedback === "negative") {
        totalPrice *= 0.90;
    }

    console.log(totalPrice.toFixed(2));
}

function onTimeForTheExam(examHour, examMinute, arrivalHour, arrivalMinute) {
    let examTime = examHour * 60 + examMinute;
    let arrivalTime = arrivalHour * 60 + arrivalMinute;

    let difference = arrivalTime - examTime;

    if (difference > 0) {
        console.log('Late');

        if (difference < 60) {
            console.log(`${difference} minutes after the start`);
        } else {
            let hours = Math.floor(difference / 60);
            let minutes = (difference % 60).toString().padStart(2, '0');
            console.log(`${hours}:${minutes} hours after the start`);
        }
    } else if (difference >= -30) {
        console.log('On time');

        if (difference !== 0) {
            console.log(`${Math.abs(difference)} minutes before the start`);
        }
    } else {
        console.log('Early');
        let absDifference = Math.abs(difference);

        if (absDifference < 60) {
            console.log(`${absDifference} minutes before the start`);
        } else {
            let hours = Math.floor(absDifference / 60);
            let minutes = (absDifference % 60).toString().padStart(2, '0');
            console.log(`${hours}:${minutes} hours before the start`);
        }
    }
}

